// 現在のページを取得する。
var page = Forguncy.Page;
// 添付ファイルセルを取得する。
var temp = page.getCell("添付ファイル").getValue();
// NFKC変換
var normalized = temp.normalize("NFC");
// 変換値をセットする
page.getCell("変換ファイル").setValue(normalized);

// 現在のページを取得する。
var page = Forguncy.Page;
// リストビューオブジェクトを取得する。
var listview = page.getListView("物件リストビュー");
// リストビューの行数を取得する。
var count = listview.getRowCount();
// リストビューをループしてNFKC変換
for (var i = 0; i < count; i++) {

     var tmpVal = listview.getValue(i, "物件名");
     if (tmpVal !== null) { 
        var normalized = tmpVal.normalize("NFC");
         listview.setValue(i, "物件名", normalized);
    }

     var tmpVal = listview.getValue(i, "市区郡名");
     if (tmpVal !== null) { 
        var normalized = tmpVal.normalize("NFKC");
         listview.setValue(i, "市区郡名", normalized);
    }

     var tmpVal = listview.getValue(i, "町名番地");
     if (tmpVal !== null) { 
        var normalized = tmpVal.normalize("NFKC");
         listview.setValue(i, "町名番地", normalized);
    }

     var tmpVal = listview.getValue(i, "添付ファイル");  
     if (tmpVal !== null) { 
        var normalized = tmpVal.normalize("NFC");
         listview.setValue(i, "変換ファイル", normalized);
    }
}
